Dictionary<string, int> Txns = new Dictionary<string, int>();\n\n// ... populate the dictionary ...\n\n// Txns contains references to its contents (key-value pairs)\n// Setting Txns to null only removes the reference to the dictionary itself\nTxns = null;\n\n// The dictionary's contents are still referenced by the dictionary's internal data structures\n// The garbage collector won't collect the contents yet\n\nGC.Collect(); // doesn't collect the contents\n\n// Now, let's clear the dictionary before setting it to null\nTxns = new Dictionary<string, int>();\n// ... populate the dictionary ...\nTxns.Clear(); // removes references to the contents\nTxns = null;\n\n// The garbage collector can now collect the contents\nGC.Collect(); // collects the contents